class HelloPropsComp extends Component
{
    constructor(props)
    {
        super(props)
    }

    render()
    {
        return (<div style={{border:'4px solid purple',backgroundColor:'lightpink'}}>

            <h3> Hello {this.props.name}</h3>
            age: {this.props.age}

        </div>)
    }
}

export default HelloPropsComp;
